(11, 'manual', 0, 'Eye Services', 'page/eye-services', 'page', 'eye-services', '', '', '', '', '<div class=\"row\">\r\n<div class=\"col-md-3\">\r\n<ul class=\"nav nav-pills doctortap\">\r\n	<li class=\"active\"><a aria-expanded=\"false\" data-toggle=\"tab\" href=\"#cataract_surgery\">Cataract Surgery</a></li>\r\n	<li><a aria-expanded=\"false\" data-toggle=\"tab\" href=\"#eye_surgeries\">Eye Surgeries</a></li>\r\n	<li><a aria-expanded=\"false\" data-toggle=\"tab\" href=\"#eye_test\">Comprehensive Eye Tests</a></li>\r\n	<li><a aria-expanded=\"true\" data-toggle=\"tab\" href=\"#vision_test\">Vision Tests</a></li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"col-md-9\">\r\n<div class=\"tab-content\"><!--Start single tab pane-->\r\n<div class=\"tab-pane active\" id=\"cataract_surgery\">\r\n<div class=\"row\">\r\n<div class=\"col-md-10 col-sm-3\">\r\n<div class=\"team-member\"><span style=\"color:#FFD700;\"><img src=\"	https://draravindshospital.com/uploads/gallery/media/cataract-suregry-630x408.jpg\" /></span></div>\r\n\r\n<h4><strong><span style=\"color:#FF8C00;\"><span style=\"font-size:26px;\"><span style=\"background-color:#FFFFFF;\">Cataract Surgery</span></span></span></strong></h4>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:#000000;\"><span style=\"font-size:16px;\">Cataract surgery is performed to treat cataracts. Cataracts can cause blurry vision and increase the glare from lights. If a cataract makes it difficult for you to carry out your normal activities, your doctor may suggest cataract surgery. When a cataract interferes with the treatment of another eye problem, cataract surgery may be recommended. </span></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:#000000;\"><span style=\"font-size:16px;\">For example, doctors may recommend cataract surgery if a cataract makes it difficult for your eye doctor to examine the back of your eye to monitor or treat other eye problems, such as age-related macular degeneration or diabetic retinopathy. In most cases, waiting to have cataract surgery won\'t harm your eye, so you have time to consider your options. If your vision is still quite good, you may not need cataract surgery for many years, if ever. </span></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"color:#000000;\"><span style=\"font-size:16px;\">When considering cataract surgery, keep these questions in mind: Can you see to safely do your job and to drive? Do you have problems reading or watching television? Is it difficult to cook, shop, do yardwork, climb stairs or take medications? Do vision problems affect your level of independence? Do bright lights make it more difficult to see? </span></span></p>\r\n</div>\r\n\r\n<div class=\"col-md-4 col-sm-6\">\r\n<div class=\"team-member\" style=\"background: #36454F;\">\r\n<p style=\"text-align: center;\"><img src=\"https://draravindshospital.com/uploads/gallery/media/draravind-1.jpg\" style=\"width: 286px; height: 408px;\" /></p>\r\n\r\n<h4 style=\"text-align: center;\">Dr. Aravind</h4>\r\n\r\n<p style=\"text-align: center;\">Professor</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-md-4 col-sm-6 float-right\" style=\"margin-left: 150px;\">\r\n<div class=\"team-member\" style=\"background: #36454F;\">\r\n<p style=\"text-align: center;\"><img src=\"https://draravindshospital.com/uploads/gallery/media/drlaxmi-11.jpg\" style=\"width: 286px; height: 408px;\" /></p>\r\n\r\n<h4 style=\"text-align: center;\">Dr. Laxmi</h4>\r\n\r\n<p style=\"text-align: center;\">Professor</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"tab-pane\" id=\"eye_surgeries\">\r\n<div class=\"row\">\r\n<div class=\"col-md-10 col-sm-3\">\r\n<div class=\"team-member\"><span style=\"color:#FFD700;\"><img src=\"	https://draravindshospital.com/uploads/gallery/media/cataract-suregry-630x408.jpg\" /></span></div>\r\n\r\n<h4><strong><span style=\"color:#FF8C00;\"><span style=\"font-size:26px;\"><span style=\"background-color:#FFFFFF;\">Eye Surgery<