(20, 'manual', 0, 'about us', 'page/about-us', 'page', 'about-us', '', '', '', '', '<style type=\"text/css\">img{\r\nborder-radius:20px;\r\n}\r\n</style>\r\n<div class=\"row\">\r\n<div class=\"col-md-6 col-sm-6\"><span style=\"font-family:georgia,serif;\"><img src=\"https://sivaeyehospital.com/uploads/gallery/media/DC_0709.JPG\" style=\"width: 475px; height: 375px; margin-left: 25px; margin-right: 25px;\" /></span></div>\r\n\r\n<div class=\"col-md-6 col-sm-6\">\r\n<h2 class=\"mt0\"><span style=\"font-family:georgia,serif;\"><span style=\"font-size:36px;\"><span style=\"color:#000000;\"><strong>S</strong></span></span><strong><span style=\"font-size:24px;\"><span style=\"color:#0066b3;\">iva Eye Hospital</span></span></strong></span></h2>\r\n\r\n<p><span style=\"color:#FFFFFF;\">siva</span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:16px;\"><span style=\"font-family:georgia,serif;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Siva eye Hospital is a state of art super speciality eye hospital in Hyderabad started in the year 1987 by Dr.M.Sambasiva Rao. It started as a small clinic and evolved into a super speciality eye hospital. Siva Eye Hospital is equipped with latest equipment to deliver high quality eye care services which are affordable to all.</span></span></p>\r\n\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:16px;\"><span style=\"font-family:georgia,serif;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;It is one most trusted hospital in Hyderabad providing high quality and personalized care in the areas of modern cataract surgery and with a specialised care in retina, cornea and glaucoma.</span></span></p>\r\n\r\n<div class=\"row pt10\">\r\n<div class=\"col-md-6 col-sm-6\">&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"row mt10\">\r\n<div class=\"col-md-6 col-sm-6\">\r\n<h2 class=\"mt0\"><span style=\"font-family:georgia,serif;\"><span style=\"color:#000000;\"><strong><span style=\"font-size:36px;\">D</span></strong></span><span style=\"color:#0066b3;\"><strong><span style=\"font-size:24px;\">r Sambasivarao</span></strong></span></span></h2>\r\n\r\n<p><span style=\"font-size:16px;\"><span style=\"font-family:georgia,serif;\"><strong>Dr.M.SambasivaRao  chairman</strong>&nbsp;(<strong>MBBS;M.S;D.O)</strong></span></span></p>\r\n\r\n<p><span style=\"font-size:16px;\"><span style=\"font-family:georgia,serif;\"><strong>Cataract and refractive surgeon,squint surgeon</strong></span></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:16px;\"><span style=\"font-family:georgia,serif;\">He is the founder and chairman of the hospital. He has 30 years of experience in treating eye diseases. He has a vast experience in performing modern cataract surgery and refractive surgeries. He also performs various eye surgeries like strabismus(Squint), pterygium and trabeculectomy</span></span></p>\r\n\r\n<p><span style=\"font-size:16px;\"><span style=\"font-family:georgia,serif;\"><strong><em>EDUCATIONAL BACKGROUND:- </em></strong></span></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:16px;\"><span style=\"font-family:georgia,serif;\">Completed his MBBS from Guntur medical college in the year 1982.Completed his M.S from Osmania medical college in the year 1987.Trained in refractive surgeries in the year 2007.</span></span></p>\r\n</div>\r\n\r\n<div class=\"col-md-6 col-sm-6\"><span style=\"font-family:georgia,serif;\"><img src=\"https://sivaeyehospital.com/uploads/gallery/media/DOCTOR PHOTO.jpg\" style=\"width: 487px; height: 300px; margin-left: 50px; margin-right: 50px;\" /></span></div>\r\n</div>\r\n\r\n<div class=\"row mt10\">\r\n<div class=\"col-md-4 col-sm-4\"><span style=\"font-family:georgia,serif;\"><img alt=\"img_9999\" src=\"https://sivaeyehospital.com/uploads/gallery/media/drvishal.png\" style=\"width: 300px; height: 450px; margin-top: 50px; margin-bottom: 50px;\" /></span></div>\r\n\r\n<div class=\"col-md-8 col-sm-8\">\r\n<h2 class=\"mt0\"><span style=\"font-family:georgia,serif;\"><span style=\"color:#000000;\"><strong><span style=\"font-size:36px;\">D</span></strong></span><span style=\"color:#0066b3;\"><span style=\"font-size:24px;\"><strong>r Vishal</strong></span></span></span></h2>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:16px;\"><span style=\"font-family:georgia,serif;\"><strong>Dr.Vishal .M.Y [MBBS;DNB(Ophthal);FVRS(Aravind Eye Hospital,Madurai)]</strong></span></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:16px;\"><span style=\"font-family:georgia,serif;\"><strong>Vitreo-Retina specialist</strong></span></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:16px;\"><span style=\"font-family:georgia,serif;\"><strong>Specialised in the treatment of retina diseases like Diabetic retinopathy, Macular disorders and Retinal detachment.</strong></span></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:16px;\"><span style=\"font-family:georgia,serif;\"><strong><em>EDUCATIONAL BACKGROUND:- </em></strong></span></span></p>\r\n\r\n<ul style=\"list-style-type:circle;\">\r\n	<li style=\"text-align: justify;\"><span style=\"font-size:16px;\"><span style=\"font-family:georgia,serif;\">Completed his MBBS from S.V.S medical college, Mahabubnagar in year 2008.</span></span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"font-size:16px;\"><span style=\"font-family:georgia,serif;\">Completed his DNB in ophthalmology from Pushpagiri Eye Hospital, Secunderabad in year 2013.</span></span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"font-size:16px;\"><span style=\"font-family:georgia,serif;\">Completed his Fellowship in Vitreo-retina from Aravind Eye Hospital, Madurai in year 2015</span></span></li>\r\n</ul>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:16px;\"><span style=\"font-family:georgia,serif;\"><strong><em>WORK EXPERIENCE:-</em></strong></span></span></p>\r\n\r\n<ul style=\"list-style-type:circle;\">\r\n	<li style=\"text-align: justify;\"><span style=\"font-size:16px;\"><span style=\"font-family:georgia,serif;\">Worked as a consultant in Vitreo-retina department in Aravind Eye Hospital, Madurai from June 2015 to December 2017.</span></span></li>\r\n</ul>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:16px;\"><span style=\"font-family:georgia,serif;\"><strong><em>ACADEMIC WORK AND RESEARCH:-</em></strong></span></span></p>\r\n\r\n<ul style=\"list-style-type:circle;\">\r\n	<li style=\"text-align: justify;\"><span style=\"font-size:16px;\"><span style=\"font-family:georgia,serif;\">Presented 5 scientific papers and 13 posters and E-posters in various national and international conferences.</span></span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"font-size:16px;\"><span style=\"font-family:georgia,serif;\">Delivered an instruction course on management of PCR and its complications in 2<sup>nd</sup> Telangana state ophthalmic conference in 2016.</span></span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"font-size:16px;\"><span style=\"font-family:georgia,serif;\">Delivered an instruction course on Intra-vitreal injections in Endophthalmitis in 3<sup>rd</sup> Telangana state ophthalmic conference in 2017.</span></span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"font-size:16px;\"><span style=\"font-family:georgia,serif;\">Graduation in AIOS national leadership development program in 2016.</span></span></li>\r\n	<li style=\"text-align: justify;\"><span style=\"font-size:16px;\"><span style=\"font-family:georgia,serif;\">C0-principal investigator in phase 3 global study on A randomized, controlled study evaluating the efficacy and safety of <u>X</u>XX compared with XXXX for the treatment of <u>IN</u>fants <u>BO</u>rn prematurely <u>W</u>ith retinopathy of prematurity(RAINBOW study)-ongoing study.</span></span></li>\r\n</ul>\r\n</div>\r\n</div>\r\n\r\n<div class=\"row mt10\">\r\n<div class=\"col-md-8 col-sm-8\">\r\n<h2 class=\"mt0\"><span style=\"font-size:36px;\"><span style=\"font-family:georgia,serif;\"><span style=\"color:#000000;\"><strong>D</strong></span><span style=\"color:#0066b3;\"><strong>r Lumbini Devi.V</strong></span></span></span></h2>\r\n\r\n<p><span style=\"font-size:16px;\"><span style=\"font-family:georgia,serif;\"><strong>MBBS;M.S(Ophthal);FCRS(Aravind Eye Hospital,Madurai)</strong></span></span></p>\r\n\r\n<p><span style=\"font-size:16px;\"><span style=\"font-family:georgia,serif;\"><strong>Cornea and Refractive surgeon</strong></span></span></p>\r\n\r\n<p><span style=\"font-size:16px;\"><span style=\"font-family:georgia,serif;\"><strong><em>EDUCATIONAL BACKGROUND:- </em></strong></span></span></p>\r\n\r\n<ul style=\"list-style-type:circle;\">\r\n	<li><span style=\"font-size:16px;\"><span style=\"font-family:georgia,serif;\">Completed her MBBS from S.V.S medical college, Mahabubnagar in year 2008.</span></span></li>\r\n	<li><span style=\"font-size:16px;\"><span style=\"font-family:georgia,serif;\">Completed her M.S in ophthalmology from Kamineni medical college in year 2013.</span></span></li>\r\n	<li><span style=\"font-size:16px;\"><span style=\"font-family:georgia,serif;\">Completed her Fellowship in Cornea and Refractive surgery from Aravind Eye Hospital, Madurai in year 2015</span></span></li>\r\n</ul>\r\n\r\n<p><span style=\"font-size:16px;\"><span style=\"font-family:georgia,serif;\"><strong><em>WORK EXPERIENCE:-</em></strong></span></span></p>\r\n\r\n<ul style=\"list-style-type:circle;\">\r\n	<li><span style=\"font-size:16px;\"><span style=\"font-family:georgia,serif;\">Worked as a consultant in Cornea department in Aravind Eye Hospital, Madurai for 2 years.</span></span></li>\r\n</ul>\r\n\r\n<p><span style=\"font-size:16px;\"><span style=\"font-family:georgia,serif;\"><strong><em>AWARDS:-</em></strong></span></span></p>\r\n\r\n<ul>\r\n	<li><span style=\"font-size:16px;\"><span style=\"font-family:georgia,serif;\">Awarded gold medal for anatomy in MBBS 1 year in SVS medical college</span></span></li>\r\n	<li><span style=\"font-size:16px;\"><span style=\"font-family:georgia,serif;\">Awarded gold medal for ENT and ophthalmology in MBBS final part 1in SVS medical college</span></span></li>\r\n	<li><span style=\"font-size:16px;\"><span style=\"font-family:georgia,serif;\">Awarded gold medal for overall highest in MBBS final part 1 in SVS medical college</span></span></li>\r\n	<li><span style=\"font-size:16px;\"><span style=\"font-family:georgia,serif;\">Awarded gold medal as best outgoing student in M.S(ophthalmology) in kamineni medical college</span></span></li>\r\n	<li><span style=\"font-size:16px;\"><span style=\"font-family:georgia,serif;\">Awarded best paper of the conference in Telangana ophthalmic society conference held in Warangal in 2015.</span></span></li>\r\n	<li><span style=\"font-size:16px;\"><span style=\"font-family:georgia,serif;\">Awarded 2<sup>nd</sup> prize for best clinical photograph in Keracon conference held in Hyderabad in 2017.</span></span></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n\r\n<div class=\"col-md-4 col-sm-4\"><img src=\"https://sivaeyehospital.com/uploads/gallery/media/DOCTOR PHOTO DR.LUMBINI.jpg\" style=\"height: 246px; width: 400px; margin-top: 100px; margin-bottom: 100px;\" /></div>\r\n</div>\r\n\r\n<div class=\"row\">\r\n<div class=\"col-md-12 col-sm-12\">\r\n<h2 class=\"mt0\">&nbsp;</h2>\r\n</div>\r\n</div>\r\n\r\n<h2 class=\"mt0 text-center\"><span style=\"font-family:georgia,serif;\">OUR SPECIALISTS</span></h2>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div class=\"row text-center\">\r\n<div class=\"col-md-3 col-sm-6\">\r\n<div class=\"team-member\"><img src=\"https://sivaeyehospital.com/uploads/gallery/media/sambapassport.png\" />\r\n<h4><span style=\"font-family:georgia,serif;\"><span style=\"font-size: 16px; text-align: justify;\">Dr