(21, 'manual', 0, 'test_eye_services', 'page/test_eye_services', 'page', 'test_eye_services', '', '', '', '', '<style type=\"text/css\">.nav-pills>li.active>a, .nav-pills>li.active>a:focus, .nav-pills>li.active>a {\r\n    background-image: radial-gradient(white,white, #1f7cba,#144f77, #144f77);\r\n    color: black;\r\n    text-align: center;\r\n}\r\n.nav>li>a:hover {\r\n    background-color: black!important;\r\n}\r\n.doctortap li a {\r\n    text-align: center;\r\n}\r\n.team-member {\r\nbackground-color:white;\r\nborder: 0px solid white;\r\nbox-shadow: 0px 0px 0px rgba(0, 0, 0, 0);\r\n\r\n}\r\n.team-member img {\r\n    border-radius: 95%;\r\n    border: 0.2px solid slategray;\r\n    box-shadow: 5px 5px 50px 2px #1f7cba;\r\n}\r\n</style>\r\n<div class=\"row\">\r\n<div class=\"col-md-3\">\r\n<ul class=\"nav nav-pills doctortap\">\r\n	<li class=\"active\" style=\"text-align: justify;\"><a aria-expanded=\"false\" data-toggle=\"tab\" href=\"#Vitreo\">Vitreo  Retinal and Macula Consultation</a></li>\r\n	<li style=\"text-align: justify;\"><a aria-expanded=\"false\" data-toggle=\"tab\" href=\"#Advanced\">Advanced SuturelessMicroincision Vitrectomy Surgery</a></li>\r\n	<li style=\"text-align: justify;\"><a aria-expanded=\"false\" data-toggle=\"tab\" href=\"#Uveitis\">Uveitis and Neuro Ophthalmology Consultation</a></li>\r\n	<li style=\"text-align: justify;\"><a aria-expanded=\"true\" data-toggle=\"tab\" href=\"#Intravitreal\">Intravitreal Injections</a></li>\r\n	<li style=\"text-align: justify;\"><a aria-expanded=\"false\" data-toggle=\"tab\" href=\"#Management\">Management of Nucleus drop, IOL drop and Endophthalmitis</a></li>\r\n	<li style=\"text-align: justify;\"><a aria-expanded=\"true\" data-toggle=\"tab\" href=\"#Secondary\">Secondary IOL  SFIOL (Sutureless and Glueless)</a></li>\r\n	<li style=\"text-align: justify;\"><a aria-expanded=\"true\" data-toggle=\"tab\" href=\"#Retinal\">Retinal Lasers</a></li>\r\n	<li style=\"text-align: justify;\"><a aria-expanded=\"true\" data-toggle=\"tab\" href=\"#Retinopathy\">Retinopathy of Prematurity  Screening and Management</a></li>\r\n	<li style=\"text-align: justify;\"><a aria-expanded=\"true\" data-toggle=\"tab\" href=\"#Diabetic\">Diabetic Retinopathy  Screening and Management</a></li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"col-md-9\">\r\n<div class=\"tab-content\">\r\n<p style=\"text-align: justify;\"><!--Start single tab pane--></p>\r\n\r\n<div class=\"tab-pane active\" id=\"Vitreo\">\r\n<div class=\"row\">\r\n<div class=\"col-md-10 col-sm-3\">\r\n<div class=\"team-member\" style=\"text-align: justify;\"><img src=\"https://sivaeyehospital.com/uploads/gallery/media/banner1.jpg\" style=\"width: 762px; height: 399px;\" /></div>\r\n\r\n<h4 style=\"text-align: center;\">&nbsp;</h4>\r\n\r\n<h4 style=\"text-align: center;\"><u><span style=\"font-family: georgia, serif;\"><span style=\"font-size:36px;\"><b><i>V</i></b>itreo  Retinal and Macula Consultation</span></span></u></h4>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-size:22px;\"><u><span style=\"font-family: georgia, serif;\"><b><i>V</i></b>itreo  Retinal and Macula Consultation</span></u></span></p>\r\n\r\n<p><span style=\"font-size: 16px;\"><span style=\"font-family: georgia, serif;\">Although the eye is a small part of the human body, it has the most wonderful power that a person can possess. The power of vision. Every part of the eye works towards keeping it healthy in some or the other way. While some part of the eye keeps the eye moist, another part protects the inner eye against foreign particles and infections and one of these parts receives light, converts it into neural signals and sends it to the brain for visual recognition.<br />\r\nThis part of the eye is the&nbsp;<strong>retina</strong>.</span></span></p>\r\n\r\n<p><br />\r\n<span style=\"font-size: 16px;\"><span style=\"font-family: georgia, serif;\">But then, sometimes there can be certain conditions that might affect the working of the retina, ultimately leading to visual impairment. So, when theres something thats obstructing the light reach your eyes, it might be a symptom of a particular condition and you would want to know whats blocking it, right?</span></span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; transition: all 0.3s ease-out 0s; font-family: Rubik, sans-serif; font-size: 16px; color: rgb(119, 119, 119); line-height: 27px; -webkit-tap-highlight-color: transparent !important; text-align: justify;\"><a name=\"_GoBack\"></a><span style=\"font-family: georgia, serif; color: rgb(51, 51, 51);\">If you think you have a retina condition, or if you feel theres a disturbance in your eye thats causing troubled vision, feel free to walk in for a consultation with the best retina specialists in Hyderabad, at Siva Eye Hospital.</span><span style=\"color:#000000;\"><span style=\"font-family:georgia,serif;\"><span style=\"font-size:16px;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; transition: all 0.3s ease-out 0s; -webkit-tap-highlight-color: transparent !important;\">ECCE is </span></span></span></span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; transition: all 0.3s ease-out 0s; font-family: Rubik, sans-serif; font-size: 16px; color: rgb(119, 119, 119); line-height: 27px; -webkit-tap-highlight-color: transparent !important; text-align: justify;\"><span style=\"color:#000000;\"><span style=\"font-family:georgia,serif;\"><span style=\"font-size:16px;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; transition: all 0.3s ease-out 0s; -webkit-tap-highlight-color: transparent !important;\">&nbsp;</span></span></span></span></p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"tab-pane\" id=\"Retinopathy\">\r\n<div class=\"row\">\r\n<div class=\"col-md-10 col-sm-3\">\r\n<div class=\"team-member\" style=\"text-align: justify;\"><img src=\"https://sivaeyehospital.com/uploads/gallery/media/banner1.jpg\" style=\"width: 709px; height: 399px;\" /></div>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 0cm; padding: 0px; transition: all 0.3s ease-out 0s; font-family: Rubik, sans-serif; font-size: 16px; color: rgb(119, 119, 119); line-height: normal; -webkit-tap-highlight-color: transparent !important; text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><u><em><span style=\"font-size:36px;\">Retinopathy of Prematurity  Screening and Management</span></em></u></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 0cm; padding: 0px; transition: all 0.3s ease-out 0s; font-family: Rubik, sans-serif; font-size: 16px; color: rgb(119, 119, 119); line-height: normal; -webkit-tap-highlight-color: transparent !important; text-align: justify;\">&nbsp;</p>\r\n\r\n<p style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; box-sizing: border-box; margin: 0cm; padding: 0px; transition: all 0.3s ease-out 0s; font-family: Rubik, sans-serif; font-size: 16px; color: rgb(119, 119, 119); line-height: 27px; text-align: justify; -webkit-tap-highlight-color: transparent !important;\"><span style=\"font-size: 22px;\"><span style=\"color: rgb(21, 137, 255);\"><span style=\"font-family: georgia, serif;\">Dummy Text:&nbsp;</span></span></span></p>\r\n\r\n<ul>\r\n	<li style=\"box-sizing: border-box; margin: 0cm; padding: 0px; transition: all 0.3s ease-out 0s; font-family: Rubik, sans-serif; font-size: 16px; color: rgb(119, 119, 119); line-height: 20.25pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-indent: -18pt; -webkit-tap-highlight-color: transparent !important;\"><span style=\"font-family: georgia, serif;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"box-si