(22, 'manual', 0, 'about', 'page/about', 'page', 'about', '', '', '', '', '<div class=\"row\">\r\n<div class=\"col-md-6 col-sm-6\"><img src=\"https://swarupeye.com/new/uploads/gallery/media/60yrs.png\" style=\"height: 500px; width: 600px;\" /></div>\r\n\r\n<div class=\"col-md-6 col-sm-6\">\r\n<h2 class=\"mt0\"><strong>Some Words About Us</strong></h2>\r\n\r\n<p>Siva eye Hospital is a state of art super speciality eye hospital in Hyderabad started in the year 1987 by Dr.M.Sambasiva Rao. It started as a small clinic and evolved into a super speciality eye hospital. Siva Eye Hospital is equipped with latest equipment to deliver high quality eye care services which are affordable to all.</p>\r\n\r\n<p>It is one most trusted hospital in Hyderabad providing high quality and personalized care in the areas of modern cataract surgery and with a specialised care in retina, cornea and glaucoma.</p>\r\n\r\n<div class=\"row pt10\">\r\n<div class=\"col-md-6 col-sm-6\">\r\n<ul class=\"list1\">\r\n	<li>Vitreo  Retinal and Macula Consultation</li>\r\n	<li>Advanced SuturelessMicroincision Vitrectomy Surgery</li>\r\n	<li>Uveitis and Neuro Ophthalmology Consultation</li>\r\n	<li>Intravitreal Injections</li>\r\n	<li>Management of Nucleus drop, IOL drop and Endophthalmitis</li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"col-md-6 col-sm-6\">\r\n<ul class=\"list1\">\r\n	<li>Secondary IOL  SFIOL (Sutureless and Glueless)</li>\r\n	<li>Retinal Lasers</li>\r\n	<li>Retinopathy of Prematurity  Screening and Management</li>\r\n	<li>Diabetic Retinopathy  Screening and Management</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div style=\"height: 100px; clear: both;\">&nbsp;</div>\r\n\r\n<div class=\"row\">\r\n<div class=\"col-md-8 col-sm-8\">\r\n<h2 class=\"mt0\">Our Mission</h2>\r\n\r\n<p>To provide high quality, ethical and state of the art eye care with a focus on patient satisfaction & compassionate service</p>\r\n\r\n<div class=\"row\">\r\n<div class=\"col-md-6 col-sm-6\">\r\n<div c