INSERT INTO `notification_setting` (`id`, `type`, `is_mail`, `is_sms`, `is_mobileapp`, `is_notification`, `display_notification`, `display_sms`, `template`, `template_id`, `subject`, `variables`, `created_at`) VALUES
(1, 'opd_patient_registration', 0, 0, 0, 0, 1, 1, 'Dear {{patient_name}} your OPD Registration at Siva Eye Hospital is successful on date {{appointment_date}} with Patient Id {{patient_id}} and OPD No {{opdno}}', '', 'OPD Patient', '{{patient_name}} {{appointment_date}} {{patient_id}} {{opdno}}', '2023-11-05 01:47:52'),
(2, 'ipd_patient_registration', 0, 0, 0, 0, 1, 1, 'Dear {{patient_name}} your IPD Registration at Siva Eye Hospital is successful  with Patient Id {{patient_id}} and IPD No {{ipd_no}}', '', 'IPD Patient Registration', '{{patient_name}} {{patient_id}} {{ipd_no}}', '2023-11-05 01:48:19'),
(3, 'ipd_patient_discharged', 0, 0, 0, 0, 1, 1, 'IPD Patient {{patient_name}} is now discharged from Siva Eye Hospital\r\nTotal bill amount is {{currency_symbol}}{{total_amount}}\r\nTotal paid amount is {{currency_symbol}}{{paid_amount}}\r\nTotal balance bill amount is {{currency_symbol}}{{balance_amount}}', '', 'IPD Patient Discharge', '{{patient_name}} {{currency_symbol}} {{total_amount}} {{paid_amount}} {balance_amount}}', '2023-11-05 01:48:39'),
(5, 'login_credential', 0, 0, 0, 0, 0, 1, 'Hello {{display_name}} your Siva Eye Hospital login details are Url: {{url}} Username: {{username}} Password: {{password}}', '', 'Dr.Aravinds Hospital Login Credential', '{{display_name}} {{url}} {{username}} {{password}}', '2023-11-05 01:48:52'),
(6, 'appointment_approved', 0, 0, 0, 0, 1, 1, 'Dear {{patient_name}} your appointment with {{staff_name}} {{staff_surname}} is confirmed on {{date}} with appointment no: {{appointment_no}}', '', 'Appointment Approved', '{{patient_name}} {{staff_name}}\n{{staff_surname}}  {{date}} {{appointment_no}}', '2022-11-24 09:15:20'),
(7, 'live_meeting', 0, 0, 0, 0, 0, 1, 'Dear staff, your live meeting {{title}} has been scheduled on {{date}} for the duration of {{duration}} minute.', '', 'Live Meeting', '{{title}} {{date}} {{duration}}', '2022-11-24 09:15:20'),
(8, 'live_consult', 0, 0, 0, 0, 1, 1, 'Dear patient, your live consultation {{title}} has been scheduled on {{date}} for the duration of {{duration}} minute.', '', 'Live Consultation', '{{title}} {{date}} {{duration}}', '2022-11-24 09:15:20'),
(9, 'opd_patient_discharged', 0, 0, 0, 0, 1, 1, 'OPD No {{opd_no}}  {{patient_name}} is now discharged from Siva Eye Hospital.\r\n\r\nTotal bill amount was {{currency_symbol}}  {{total_amount}} \r\nTotal paid amount was {{currency_symbol}}{{paid_amount}}  \r\nTotal balance amount is {{currency_symbol}}{{balance_amount}}', '', 'OPD Patient Discharged', '{{patient_name}} {{mobileno}} {{email}} {{dob}} {{gender}} {{patient_unique_id}} {{opd_no}}{{currency_symbol}} {{billing_amount}}', '2023-11-05 01:49:16'),
(10, 'forgot_password', 0, 0, 0, 0, 0, 0, 'Dear  {{display_name}}, recently a request was submitted to reset password for your account with email: {{email}}. If you didn\'t make the request, just ignore this email, otherwise you can reset your password using this link <a href=\'{{resetpasslink}}\'>click here to reset your password</a>, if you\'re having trouble clicking the password reset link, copy and paste below URL  into your web browser. {{resetpasslink}} <br> Regards,  <br>\r\nSiva Eye Hospital', '', 'Reset Password Request', '{{display_name}}  {{email}}  {{resetpasslink}', '2023-11-05 01:49:26');
